  return (
    <div
      style={{
        display: "flex",
        justifyContent: "space-around",
        alignItems: "center",
        backgroundColor: "pink",
      }}
    >
      <h1>Chat App</h1>
      <SignIn />
    </div>
  );
}

export default Navbar;
